From Mattias Jernberg (comment on Flash hunt page):

There's a thirdpartysoftwarelicenses.txt in the firmware, it's 2.2  0.5MB, using zstd it becomes 150KiB, using xz it becomes 110KiB. Both libzstd and liblzma is on the camera, also, what is the requirement, must it be plain text from the device or could we deliver that file compressed to the client?

Fredrik D and Ola X have discussed if possible to remove completely and just link to axis.com.

[~larsr@axis.com] Check legal requirements with Hiromi/Vanina. Done, see comments
----
There is no way to get {{apache}} to just decompress anything except {{gzip}} on the fly. If we want to use something like {{xz}} we will have to add a small cgi script.
{code:bash}
#!/bin/sh -e
printf "Content-type: text/plain\n\n"
xzcat /usr/html/thirdpartysoftwarelicenses.txt.xz
{code}
But {{unxz}} is not actually on the device. Adding just enough to be able to unpack (which would require a bbappend for xz because we would have to change the packaging) is about 78 kB (~36kB compressed). The full xz package is more than 100 kB uncompressed.

These files in flash
{noformat}
-rw-r--r--  1 www  www    2.3M Nov 17 14:51 thirdpartysoftwarelicenses.txt
-rw-r--r--  1 www  www    414k Nov 17 14:34 thirdpartysoftwarelicenses.txt.gz
-rw-r--r--  1 www  www    115k Mar  9  2018 thirdpartysoftwarelicenses.txt.xz
{noformat}
will be compressed like this by {{mksquashfs}}
{noformat}
    450117       2252365   5.00395  /usr/html/thirdpartysoftwarelicenses.txt
    405286        413573   1.02044  /usr/html/thirdpartysoftwarelicenses.txt.gz
    114332        114332       1.0  /usr/html/thirdpartysoftwarelicenses.txt.xz
{noformat}
So instead of the current ~440kB we would get ~122kB + ~36kB = ~160 kB, saving ~280 kB.

The required cgi script is very small and has no parameters. It can be considered unofficial and does not need to be documented or threat modeled.

If any tool uses the direct link to download the license file, that tool will be broken unless we add a redirect in apache:

Something like this in {{/etc/apache2/conf.d/vhosts/rewrites}}
{code}
RewriteRule    "^/old\.cgi$"  "/new.cgi" [PT]
{code}
